      Hint: ExtendedContent
      Value: "<p>Kaytee Supreme Mouse and Rat food is a wholesome, high-quality mix that contains all of the natural protein, fiber, oils and nutrients of whole grains. Fortified to ensure a balance blend, Supreme utilizes natural seeds, grains and pellets to provide your small pet with a simple yet healthy diet. Kaytee Supreme offers high quality ingredients small animals love and the nutrition they require.<br><br>Kaytee understands that sharing your life with a small pet is not only enjoyable but very enriching. Kaytee shows our love by ensuring we provide your small pet with the best nutrition for a long and healthy life. With over 150 years of nutritional experience, it's no wonder why Kaytee is at the heart of every healthy feeding routine.</p>"
